import React from "react";
import "./Home.css";
import home from "../img/home.png";

function Home() {
  return (
    <div className="home-container">
      <h1 className="home-title">
        Discover, <span className="destacar">plan</span> and cook like never before.
      </h1>
      <div className="title-line"></div> {/* Línea debajo del título */}
      <p className="home-subtitle">
        Find quick recipes, plan your meals and adapt each dish to your lifestyle. Your new kitchen companion is here!
      </p>
      <div className="home-content">
        <div className="home-buttons">
          <button className="home-button find-button">Find Recipes</button>
          <button className="home-button explore-button">Explore More</button>
        </div>
        <div className="home-image-container">
          <img src={home} className="home-image" alt="Cooking" />
        </div>
      </div>
    </div>
  );
}

export default Home;
